import React from 'react';
import logo from './logo.svg';
import './App.css';
import Row from './components/Row';

function App() {
  return (
    <>
      <div className="App">

        <Row>
          <div className="col-sm-4" style={{ backgroundColor: '#aaabbb', height: '50vh' }}>.col-sm-4</div>
          <div className="col-sm-4" style={{ backgroundColor: '#123123', height: '50vh' }}>.col-sm-4</div>
          <div className="col-sm-4" style={{ backgroundColor: '#555666', height: '50vh' }}>.col-sm-4</div>

        </Row>
        <Row>
          <div className="col-sm-4" style={{ backgroundColor: '#321321', height: '50vh' }}>.col-sm-4</div>
          <div className="col-sm-4" style={{ backgroundColor: '#aaabbb', height: '50vh' }}>.col-sm-4</div>
          <div className="col-sm-4" style={{ backgroundColor: '#898bab', height: '50vh' }}>.col-sm-4</div>

        </Row>
      </div>


    </>
  );
}

export default App;
